import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import 'bootstrap/dist/css/bootstrap.min.css';
import { OffcanvasHeader, Stack } from 'react-bootstrap';

const Menu = () => {
  const [show, setShow] = useState(false);
  const handleShow =()=>{setShow(true);}
  const handleClose =()=> {setShow(false);};
  return (
   <>
   <Navbar>
   <Nav.Offcanvas onClick={handleShow}>
    <Offcanvas 
    show={show} 
    onHide={handleClose} 
    placement='end'
    responsive='lg'>
       <Container fluid='lg'>
      <OffcanvasHeader closeButton>
        <Offcanvas.Title>
          Little Lemon
        </Offcanvas.Title>
        <Offcanvas.Body>
            <Nav className='justify-content-end flex-grow-1 col'>
              <Nav.Link href='#'>Home</Nav.Link>
              <Nav.Link href='#'>About</Nav.Link>
              <Nav.Link href='#'>Menu</Nav.Link>
              <Nav.Link href='#'>Reservations</Nav.Link>
              <Nav.Link href='#'>Order Online</Nav.Link>
              <Nav.Link href='#'>Login</Nav.Link>
            </Nav>
        </Offcanvas.Body>
      </OffcanvasHeader>
      </Container>
    </Offcanvas>
    </Nav.Offcanvas>
    </Navbar>
   </>
  )
}

export default Menu;
